import React from 'react';
import { Grid, Paper, Typography, List, ListItem, ListItemText, ListItemIcon } from '@mui/material';
import ErrorIcon from '@mui/icons-material/Error';
import WarningIcon from '@mui/icons-material/Warning';
import InfoIcon from '@mui/icons-material/Info';

const Alerts = () => {
  const alerts = [
    { severity: 'high', message: 'Firewall: High CPU Usage', timestamp: '2023-11-15 10:30' },
    { severity: 'medium', message: 'Switch: Port 5 Down', timestamp: '2023-11-15 09:45' },
    { severity: 'low', message: 'Windows Server: Available Storage < 20%', timestamp: '2023-11-15 08:15' },
  ];

  const getSeverityIcon = (severity) => {
    switch (severity) {
      case 'high':
        return <ErrorIcon color="error" />;
      case 'medium':
        return <WarningIcon color="warning" />;
      case 'low':
        return <InfoIcon color="info" />;
      default:
        return <InfoIcon />;
    }
  };

  return (
    <Grid container spacing={3}>
      <Grid item xs={12}>
        <Typography variant="h4" gutterBottom>Alerts</Typography>
      </Grid>
      <Grid item xs={12}>
        <Paper sx={{ p: 2 }}>
          <List>
            {alerts.map((alert, index) => (
              <ListItem key={index}>
                <ListItemIcon>
                  {getSeverityIcon(alert.severity)}
                </ListItemIcon>
                <ListItemText 
                  primary={alert.message}
                  secondary={alert.timestamp}
                />
              </ListItem>
            ))}
          </List>
        </Paper>
      </Grid>
    </Grid>
  );
};

export default Alerts;
